import React from "react";

class SetConstants extends React.Component {

  componentDidMount() {
    const { drizzle } = this.props;
    const contract = drizzle.contracts.PunkPrintRegistry;

  contract.methods["pricePerPrintInWei"].cacheCall();
  contract.methods["pricePerPrintIntlShipInWei"].cacheCall();
  contract.methods["pricePerNFCInWei"].cacheCall();
  contract.methods["pricePerNFCIntlShipInWei"].cacheCall();
  contract.methods["pricePerMiscInWei"].cacheCall();
  contract.methods["pricePerMiscIntlShipInWei"].cacheCall();

  }



  render(){
    return null;
}
}
export default SetConstants;
